create table tbl_Visit
(
    ID           int auto_increment
        primary key,
    Doctor       int     not null,
    `Case`       int     not null,
    Date         date    not null,
    VisitPlace   tinyint not null,
    Circumstance tinyint not null,
    constraint tbl_Visit_spr_VisitCircumstances_ID_fk
        foreign key (Circumstance) references spr_VisitCircumstances (ID),
    constraint tbl_Visit_spr_VisitPlace_ID_fk
        foreign key (VisitPlace) references spr_VisitPlace (ID),
    constraint tbl_Visit_tbl_Cases_ID_fk
        foreign key (`Case`) references tbl_Cases (ID),
    constraint tbl_Visit_tbl_Doctors_ID_fk
        foreign key (Doctor) references tbl_Doctors (ID)
);

